import React from "react";
import PropTypes from "prop-types";
import { Col, Row } from "antd";

import Skill, { POSITION_SKILL } from "./skill";

const SkillTree = () => {
  return (
    <Row>
      <Col
        style={{
          backgroundColor: "yellow",
          width: "500px",
          height: "500px",
          paddingLeft: "150px",
        }}
      >
        <div style={{ position: "relative" }}>
          <Skill id="skill-1-1" position={POSITION_SKILL.MIDDLE} top={50} left={100} />
          <Skill
            id="skill-1-2"
            position={POSITION_SKILL.RIGHT_BOTTOM}
            parentId={"skill-1-1"}
          />
          <Skill
            id={"skill-1-3"}
            position={POSITION_SKILL.MIDDLE}
            parentId={"skill-1-2"}
          />
        </div>
      </Col>
    </Row>
  );
};

SkillTree.propTypes = {
  character: PropTypes.string,
};

export default SkillTree;
